def get_board(name):
    return deepcopy(_boards_src[name])

def prepare_board(board,segments):
    for seg in segments:
        board[seg[1]][seg[0]] = seg[2]
    return board

def fix_board(board):
    d = {}
    for row in board:
        for i,cell in enumerate(row):
            if cell:
                if cell[0] not in d:
                    d[cell[0]] = [0][:]
                d[cell[0]][0]+=1
                row[i] = (cell[0],cell[1],d[cell[0]])
    return board

def recount_board(board):
    for row in board:
        for cell in row:
            if cell:
                cell[2][0]=0
    for row in board:
        for cell in row:
            if cell:
                cell[2][0]+=1
    return board


